window.bookSummaryJSON = "<p>At Castle Perilous, a magical party ends in murder and the hunt begins for whodunit in this \"fast-moving and funny\" fantasy novel (Barbara Paul, author of Kill Fee).</p> <p>Partying to death? A parlous party at the Castle Perilous comes to a dead halt when the body of viscount Oren is discovered and foul play is suspected. But who is the killer? And where is the murder weapon? The rambunctious revelers at Castle P. join in a treacherous treasure hunt for party favors of a decidedly deadly nature . . . the murder weapon must be hidden behind one of the 144,000 doors, or will it be buried in the back of the next victim?</p>"; 
